DROP TABLE product_info;
CREATE TABLE product_info(
   SN                   INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,type                 VARCHAR(7)
  ,Make                 VARCHAR(23)
  ,Model                VARCHAR(84)
  ,engine_fuel_capacity VARCHAR(9)
  ,Fuel_System          VARCHAR(3)
  ,Start_Year           VARCHAR(9)
  ,end_Year             VARCHAR(9)
  ,Filter_reference     VARCHAR(8)
  ,Comments             VARCHAR(35)
  ,Part_Number          VARCHAR(12)
  ,KN_Number            VARCHAR(8)
);
